// src/data/tryOnHistoryData.js
const tryOnHistoryData = [
    {
        id: 1,
        productName: "Lipstick X",
        triedOnDate: "2024-10-10",
        image: "/images/try-on-1.jpg" // Example placeholder image
    },
    {
        id: 2,
        productName: "Eyeshadow Palette Y",
        triedOnDate: "2024-10-08",
        image: "/images/try-on-2.jpg"
    }
];

export default tryOnHistoryData;
